import React from "react";

function ShowList() {
  return (
    <div>
      <h1>This is Showing list</h1>
      <ul>
        <li>Peruna</li>
        <li>Peruna</li>
        <li>Peruna</li>
        <li>Peruna</li>
      </ul>
    </div>
  );
}

export default ShowList;
